import React from "react"
import { Button, Checkbox, Input } from "antd"
import './Homed.css'



const HomeDesign = () => {

  const img = [
    {
      src: "https://www.pngall.com/wp-content/uploads/5/Home-Interior-Design-PNG-Image.png",
      desc: 'Frame houses',
    },
    {
      src: "https://www.pngall.com/wp-content/uploads/5/Home-Interior-Design-PNG-Image.png",
      desc: 'Glued timber houses',
    },
    {
      src: "https://www.pngall.com/wp-content/uploads/5/Home-Interior-Design-PNG-Image.png",
      desc: 'Log houses',
    },
    {
      src: "https://www.pngall.com/wp-content/uploads/5/Home-Interior-Design-PNG-Image.png",
      desc: 'Half-timbered houses',
    },
    {
      src: "https://www.pngall.com/wp-content/uploads/5/Home-Interior-Design-PNG-Image.png",
      desc: 'Gazebos',
    },
  ]
  // const [change, setChange] = useState(false)
  // const [chang, setChang] = useState(false)

  // function Click() {
  //   if (change === false) {
  //     setChange(true)
  //   } else {
  //     setChange(false)
  //   }
  // }
  // function Clic() {
  //   if (change === false) {
  //     setChang(true)
  //   } else {
  //     setChang(false)
  //   }
  // }

  return (
    <div>
      <div className="text-2xl text-center">
        Specify the area and walls of your house
      </div>
      <div className="text-xl py-8">
        <div className="px-8 text-center">
          Area of your house:
          <Checkbox className="px-8"> 50-100m2</Checkbox>
          <Checkbox className="px-8">100-150m2</Checkbox>
          <Checkbox className="px-8" checked> Over 150m2</Checkbox>
        </div>
      </div>
      <div className="py-8 text-center justify-center flex">
        {/* {
          img.map((img, i) => (
            <div key={i} className={change ? 'bg-orange-400 w-40 wrap' : 'w-40 wrap'}>
              <label className="main">
                <input type='checkbox' onChange={() => Click()} className="checkbox" />
                <span className="geekmark"></span>
                <img alt='image' src={img.src} />
              </label>
            </div>
          ))
        } */}
        {
          img.map((img, i) => (
            <div key={i} className='wrap flex'>
              <div>
                <label className='main'>
                  <input type="checkbox" className="checkbox" />
                  <div className="mn">
                    <img src={img.src} alt="img" />
                  </div>
                  <span className="geekmark"></span>
                </label>
                <div className="text-left font-semibold w-32"> {img.desc} </div>
              </div>
              <div className="w-4"></div>
            </div>
          ))
        }
      </div>
      <div className="text-center bg-gray-100 py-4 px-8">
        <Checkbox className="text-xl px-8">Full construction</Checkbox>
        <Checkbox className="text-xl px-8">Box</Checkbox>
      </div>
      <div className="p-4 flex items-center justify-center text-center">
        <form>
          <Input required size="large" className="m-4 w-96 bg-gray-100" placeholder="Your phone" />
          <Button type="submit" size="large" className="w-32 bg-orange-400">Check</Button>
        </form>
      </div>
      <div className="py-4 text-center">
        <Checkbox size='small'>You agree to the terms of personal data processing</Checkbox>
      </div>
    </div>
  )
}
export default HomeDesign
